import ListSearchedNews from "./ListSearchedNews";
import { css } from "@emotion/core";
import PuffLoader from "react-spinners/PuffLoader";

const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
`;

class SearchedNews extends Component {
  constructor(props) {
    super(props);
    this.state = {
      mode: "Search",
      model: "Mustang",
      color: "red",
      year: 1964,
    };
  }

  render() {
    if (news) {
      return (
        <CardDeck
          style={{ marginLeft: "60px", display: "flex", flexWrap: "wrap" }}>
          {news.map((snews) => (
            <ListSearchedNews key={snews.id} snews={snews} mode={mode} />
          ))}
        </CardDeck>
      );
    } else {
      return (
        <div className='sweet-loading'>
          <PuffLoader
            css={override}
            size={150}
            color={"#123abc"}
            loading={true}
          />
        </div>
      );
    }
  }
}
export default SearchedNews;
